      sname={Sdata[0].sname}
      link={Sdata[0].link}
    />    <Card
      imgsrc={Sdata[0].imgsrc}
      title={Sdata[0].title}
      sname={Sdata[0].sname}
      link={Sdata[0].link}
    />
  </>,

  document.getElementById("root")
);
